  {
    background: visible !important;
  }
  .container-footer
  {
    position:static;  
  }
  html
  {

    width: 100% !important;
    height: 100% !important;
 /*background-image: url(https://wallpapercave.com/uwp/uwp1840742.jpeg) !important;*/
background-size: cover !important;
background-attachment: fixed !important;
background-image: url('data:image/jpeg;base64,')!important;
}
 #party_none_title,
div.friend_dock_chatbox_titlebar.chat-header-blink-off
  {
    background: linear-gradient(to bottom, #32CD32, #1F51FF);
  }

  #ctl00_cphRoblox_RightColumn,
#Body > table > tbody > tr > td:nth-child(3),
#Body > table > tbody > tr > td:nth-child(4)
  {
    display: none;
  }

  #GamesPageLeftColumn
  {
    width: auto;
    margin-right: 10px !important;
    margin-left: 10px !important;
  }

  #GamesListsContainer > div
  {
    background-color: transparent !important;
    width: 100% !important;
  }

  #navigation
  {
    background-color:#1F51FF;
  }

  .rbx-btn-primary-lg
  {
    background-color:#239023;
  }

  .rbx-btn-primary-lg:hover, .rbx-btn-primary-lg:focus
  {
    background-color:#1F51FF;
    }

@keyframes rainbow
/*this is play button btw*/
  {
    0% {background-color: #39FF14;
    border-color: #39FF14;
  }

  14%
  {
    background-color: #1F51FF;
    border-color: #1F51FF;
  }

  28%
  {
    background-color: #39FF14;
    border-color: #39FF14;
  }

  42%
  {
    background-color: #1F51FF;
    border-color: #1F51FF;
  }

  56%
  {
    background-color: #39FF14;
    border-color: #39FF14;
  }

  80%
  {
    background-color: #1F51FF;
    border-color: #1F51FF;
  }

  94%
  {
    background-color: #39FF14;
    border-color: #39FF14;
  }

  100%
  {
    background-color: #1F51FF;
    border-color: #1F51FF;
  }
}

.btn-common-play-game-lg
{
  animation: rainbow 10s infinite;
}
